const MainBox = () => {
  const fetchTasks = async () => {
    const res = await fetch("../../../public/data.json")
    const data = await res.json()
    console.log("data:", data)

    return data
  }

  return (
    <View style={styles.mainBox}>
      <Experience />
      <Education />
    </View>
  )
}

export default MainBox
